import {slide as Menu } from 'react-burger-menu';

class NavBar extends React.Component {
    showSettings(event) {
        event.preventDefault();
    }

    render() {
        return (
            <Menu>
                <a id="home" href="/">Home</a>
            </Menu>
        )
    }
}

export default NavBar;

